import Link from "next/link";

const Navigation = () =>{

    const pages = {
            name : "Home",
            link : "/home"
    }

    return(
        <div>
            {pages.map(page =>{
                return(
                    <li>
                        <Link href="/"><a>{page}</a></Link>
                    </li> 
                )
            })}
        </div>
    )
}

export default Navigation;
